import React from 'react';
import signup from '../styles/SignUpPage.module.css'
import { Link } from 'react-router-dom';

const SignUpPage = () => {
  const clickHandler = (e) => {
    e.preventDefault();
    history.push('/list', null)
  }

  return(
    <main className={signup.main}>
      <header>
        <h1>Sign up</h1>
        <small>Hellow there! Sign up and start meeting new friends</small>
      </header>
      <form className={signup.form}>
        <label for="email">
          <input className={signup.input} id="email" type="email" placeholder="anon@mail.com" />
        </label>
        <label for="password">
          <input className={signup.input} id="password" type="password" />
        </label>
        <label for="confirmPassword">
          <input className={signup.input} id="confirmPassword" type="password" />
        </label>
        <button onClick={clickHandler} type="submit" className="btn btn--orange">
          Sign up
        </button>
      </form>
      <Link to="/" className={signup.back}>{'< Back'}</Link>
    </main>
  )
}

export default SignUpPage;
